import React from "react";
import styled from "styled-components";

export default function post() {
  return (
    <Container>
      <Nav>
        <img className="arrow" src={"./arrow-left.svg"} alt="back-arrow"></img>
        <div>글 목록으로</div>
      </Nav>
    </Container>
  );
}
const Container = styled.div`
  display: flex;
  position: relative;
  flex-direction: column;
  border: solid grey 1px;
  border-radius: 10px;
  width: 360px;
  height: 821px;
`;
const Nav = styled.div`
  .arrow {
    width: 14px;
    height: 14px;
  }
`;
